const arr = [
    {
        id: 1,
        name:'name1',
        description: 'Description1'
    },
    {
        id: 2,
        name:'name2',
        description: 'Description2'
    },
    {
        id: 3,
        name:'name3',
        description: 'Description3'
    }
]

const Items = new Promise((resolve, reject) => {
    resolve(arr.map(e => e));
 });
 Items.then(result => {
   console.log(result);
 });

 export default Items
